import React from "react";
import Commancomppro from "./Commancomppro";
const Aboutpro = () => {
    return (
        <>
         <Commancomppro
         name="welcome in about page"
         imgsrc={aboutprozym}
         visit="/contact"
         btname="Contact Now"
        />
        </>


    );
};
export default Aboutpro;
